import React, { Component } from 'react';
import CustomInput from './CustomInput';

class FormInputs extends Component {

    constructor(){
        super();
    }

    render(){
        return (
            <form >
                <CustomInput />
                <CustomInput />
                <input type="button" value="Add"/>
            </form>
        );
    }
}

export default FormInputs;
